import React from "react";

const ListRender = () => {
  let list = [
    {
      name: "Paulo",
      age: 31,
    },
    {
      name: "Marcos",
      age: 45,
    },
    {
      name: "Lucas",
      age: 18,
    },
    {
      name: "Junior",
      age: 64,
    },
    {
      name: "Jose",
      age: 28,
    }
  ];
  return (
    <>
      <h2>Lista de presen√ßa</h2>
      <ul>
        {list.map((item, key) => (
          <li key={key}>{`${item.name} - ${item.age} anos`}</li>
        ))}
      </ul>
    </>
  );
};
export default ListRender;
